import React, { useState } from 'react';


function crearGame() {
    const [radio, setRadio] = useState('');

    function handleSubmit(event: React.FormEvent) {
        event.preventDefault();   // consume el evento

        console.log(radio);
    }


    return (
        <form onSubmit={(event) => handleSubmit(event)}>
            <fieldset>
                <div className="radio">
                    <label>
                        <input type="radio" name="juego" value="Jugar contra la maquina" onChange={(event) => setRadio(event.target.value)}/>
                        Jugar contra la maquina
                    </label>

                    <br />

                    <label>
                        <input type="radio" name="juego" value="Jugar contra un amigo" checked onChange={(event) => setRadio(event.target.value)}/>
                        Jugar contra un amigo
                    </label>
                </div>

                <input type="submit" value="Crear Partida" />
            </fieldset>
        </form>
    );
}

export { crearGame };
